const dotenv = require('dotenv');
dotenv.config()

const {SHOPIFY_API_SECRET_KEY, SHOPIFY_API_KEY, PORT, NODE_ENV} = process.env

export default {
    SHOPIFY_API_SECRET_KEY, SHOPIFY_API_KEY, PORT, NODE_ENV
}
